  false,\n\t\"url\": null,\n\t\"notes\": \"The data contained in these files contain
  hydrographic and topographic data collected by the CHARTS system along the west
  coast of Florida from Hurricane Pass to Big Hickory Pass, following Hurricane Wilma.
  The data were collected and processed in geographic coordinates and ellipsoid heights.
  The positions are relative to NAD83 in decimal degrees of longitude and latitude.
  The heights were converted from ellipsoid to geoid heights (NAVD88) using the Geoid03
  model with the results in meters. The date and time of each point are also provided
  as YYYY/MM/DD HH:MM:SS.SSSSSS.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
